import React from 'react';

const Login = () => {
    return (
        <div>
            {/* Banner */}
            <section id="banner">
                <h1 style={{fontWeight: 525}}>Log In</h1>
                <p style={{fontSize: 'x-large', fontWeight: 325}}>INSERT LOG IN REACT FORM HERE</p><br />
                <h1 style={{fontWeight: 525, textAlign: 'center'}}>OR</h1>
            </section>
        </div>
    );
};

export default Login;
